    state ={
        data,
        score: 0,
        topScore: 0
    }
    render(){
        return(
            <div>
                    <Nav score={this.state.score} topScore = {this.state.topScore} />
                    <div>
                        {this.state.data.map(image => (
                            <ImgCard 
                                key={image.id}
                                id={image.id}
                                im
                            />
                        ))}
                    </div>
            </div>


        )
    }
}
